import { NavLink } from 'react-router-dom';
import React from 'react';
import OpinionSurveys from '../images/OpinionSurveys.png'
import LMSkills from '../images/LMSkills.png'
import logo from '../images/logo.png'
const Index = () => (
    <div className="col-12 col-lg-5">
    <div
    style={{
      // display: 'flex',
      flexDirection: 'row',
      justifyContent: 'center',
    }}
  >
  <h3>
    We can help you in the following ways.<br/>
    Please select the service that you are most interested in for more information:
  </h3>
  <div style={{ }}>
  <NavLink
    to="/employee-surveys/"
    style={{
      color: `#565347`,
    }}
  >
    <div style={{
      display: 'flex',
      flexDirection: 'row',
    }}>
      <div style={{
        width: '8rem',
        height: '8rem',
        padding:'0.25rem',
        marginRight: '2rem',
      }}>
        <img style={{marginBottom: 0 }} alt="logo" src={OpinionSurveys}/>
      </div>
      <div style={{ margin: 'auto 0' }}>
        <h3>
          We design and implement employee surveys.
        </h3>
      </div>
    </div>
    </NavLink>
    <NavLink
      to="/leadership-skills/"
      style={{
        color: `#565347`,
      }}
    >
    <div style={{
      display: 'flex',
      flexDirection: 'row',
    }}>

      <div style={{
        width: '8rem',
        height: '8rem',
        padding:'0.25rem',
        marginRight: '2rem',
      }}>
        <img style={{marginBottom: 0}} alt="logo" src={LMSkills}/>
      </div>
      <div style={{ margin: 'auto 0' }}>
        <h3>
          We develop management and leadership skills.
        </h3>
      </div>
    </div>
    </NavLink>


  </div>
  <NavLink
    to="/quality-of-human-capital"
    style={{
      color: `#565347`,
    }}
  >
  <div style={{
    display: 'flex',
    flexDirection: 'row',
  }}>
    <div style={{
      width: '8rem',
      padding:'0.25rem',
      marginRight: '2rem',
      height: '8rem',
    }}>
      <img style={{marginBottom: 0}} alt="logo" src={logo}/>
    </div>
    <div style={{ margin: 'auto 0' }}>
      <h3>
        We assess the quality of human capital.
      </h3>
    </div>
  </div>
  </NavLink>
  </div>
    </div>
);

export default Index;
